BEGIN TRANSACTION;
CREATE TABLE "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTO_INCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTO_INCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTO_INCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE "auth_user" ("id" integer NOT NULL PRIMARY KEY AUTO_INCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "last_name" varchar(150) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "first_name" varchar(150) NOT NULL);
CREATE TABLE "auth_user_groups" ("id" integer NOT NULL PRIMARY KEY AUTO_INCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "auth_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTO_INCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "bawabati_app_course" ("id" integer NOT NULL PRIMARY KEY AUTO_INCREMENT, "title" varchar(200) NOT NULL, "description" text NOT NULL, "capacity" integer unsigned NOT NULL CHECK ("capacity" >= 0), "created_at" datetime NOT NULL, "end_date" date NOT NULL, "instructor_id" integer NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "start_date" date NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE "bawabati_app_enrollment" ("id" integer NOT NULL PRIMARY KEY AUTO_INCREMENT, "enrollment_date" datetime NOT NULL, "course_id" bigint NOT NULL REFERENCES "bawabati_app_course" ("id") DEFERRABLE INITIALLY DEFERRED, "student_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "status" varchar(10) NOT NULL);
CREATE TABLE "bawabati_app_note" ("id" integer NOT NULL PRIMARY KEY AUTO_INCREMENT, "title" varchar(200) NOT NULL, "course_id" bigint NOT NULL REFERENCES "bawabati_app_course" ("id") DEFERRABLE INITIALLY DEFERRED, "uploaded_by_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "content" text NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "file" varchar(100) NULL);
CREATE TABLE "bawabati_app_userprofile" ("id" integer NOT NULL PRIMARY KEY AUTO_INCREMENT, "role" varchar(10) NOT NULL, "user_id" integer NOT NULL UNIQUE REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "profile_picture" varchar(100) NULL, "bio" text NOT NULL, "phone_number" varchar(15) NOT NULL);
CREATE TABLE "courses_classe" ("id" integer NOT NULL PRIMARY KEY AUTO_INCREMENT, "nom" varchar(20) NOT NULL, "niveau" varchar(50) NOT NULL);
CREATE TABLE "courses_cours" ("id" integer NOT NULL PRIMARY KEY AUTO_INCREMENT, "nom" varchar(100) NOT NULL, "classe_id" bigint NOT NULL REFERENCES "courses_classe" ("id") DEFERRABLE INITIALLY DEFERRED, "professeur_id" bigint NULL REFERENCES "teachers_professeur" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTO_INCREMENT, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0), "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "action_time" datetime NOT NULL);
CREATE TABLE "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTO_INCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTO_INCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE "grades_note" ("id" integer NOT NULL PRIMARY KEY AUTO_INCREMENT, "note" decimal NOT NULL, "date_ajout" datetime NOT NULL, "cours_id" bigint NOT NULL REFERENCES "courses_cours" ("id") DEFERRABLE INITIALLY DEFERRED, "eleve_id" bigint NOT NULL REFERENCES "students_eleve" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "students_eleve" ("id" integer NOT NULL PRIMARY KEY AUTO_INCREMENT, "nom" varchar(100) NOT NULL UNIQUE, "prenom" varchar(100) NOT NULL UNIQUE, "date_naissance" date NOT NULL, "email" varchar(100) NOT NULL UNIQUE, "classe_id" bigint NOT NULL REFERENCES "courses_classe" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "teachers_professeur" ("id" integer NOT NULL PRIMARY KEY AUTO_INCREMENT, "nom" varchar(100) NOT NULL UNIQUE, "prenom" varchar(100) NOT NULL UNIQUE, "email" varchar(192) NOT NULL UNIQUE, "matiere" varchar(100) NOT NULL UNIQUE);
